import styled from "styled-components"
import { Link, useNavigate } from "react-router-dom";

export default function ComprarPlano({ img, calendar, money }) {
    return (
        <>
            <TopBar>
                <img src={img} alt="" />
                <p>Driven Plus</p>
            </TopBar>
            <Info>
                <Beneficio>
                    <img src={calendar} alt="" />
                    <p>Benefício</p>
                </Beneficio>

                <ComponentBox>
                    <p>1. Brindes exclusivos</p>
                    <p>2. Materiais bônus de web</p>
                </ComponentBox>
            </Info>
            <Info>
                <input   
                type="text"
                placeholder="Nome impresso no cartão"
                />
                <input   
                type="text"
                placeholder="Digitos do cartão"
                />
                <InputMenor>
                <input   
                type="text"
                placeholder="Código de segurança"
                />
                 <input   
                type="text"
                placeholder="Validade"
                />
                </InputMenor>
            </Info>

        </>
    )
}

const TopBar = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 87px 38px 24px 38px;
    margin-bottom: 21px;
    color: #FFFFFF;
    font-weight: 700;
    font-size: 32px;
    line-height: 38px;
    img{
        width: 139.38px;
        height: 95.13px;
    }
`
const Info = styled.div`
    display: flex;
    flex-direction: column;
    margin: 0 auto;
    width: 299px;
    height: auto;
    input{
        border-radius: 8px;
        width: 299px;
        height: 52px;
        background-color: #FFFFFF;
        margin-bottom: 16px;
        padding: 5%;
        cursor: text;
    }
`
const Beneficio = styled.div`
    display: flex;
    justify-content: start;
    align-items: center;
    font-weight: 400;
    font-size: 16px;
    line-height: 19px;
    color:#FFFFFF;
    img{
        width: 12px;
        height: 16px;
        margin-right: 5px;
    }
`
const ComponentBox = styled.div`
    margin-top: 10px;
    display: flex;
    flex-direction: column;
    color:#FFFFFF;
    font-size: 14px;
    line-height: 16px;
    margin-bottom: 52px;
`
const InputMenor = styled.div`
    display: flex;
    justify-content: space-between;
input{
    width: 49%;

}
`
